var resp = response_body;

if(resp === null) {
  var response = {};
  response.Error = "Specified Id not found";
  done({
    "response_status_code": 404,
    "response_body": response
  })
} else {
  done()
}

var resp = response_body;

if(resp === null) {
  var response = {};
  response.Error = "Specified Id not found";
  done({
    "response_status_code": 404,
    "response_body": response
  })
} else {
  done()
}

var body = {
  "Engineer": {
    "ID": "1005",
    "District": {"Name": "Miami"}
  },
  "TimeInterval": {
    "Start": "2016-12-01T09:00:00",
    "Finish": "2016-12-01T17:00:00"
  },
  "WithNA": false,
  "TaskRequestedProperties": ["Key", "CallID"],
  "AssignmentRequestedProperties": ["Key", "Task", "Start", "Finish"]
}

var id = request_path_variables['id'];
var start = request_parameters['start'];
var finish = request_parameters['finish'];
var district = request_parameters['district'];

body['Engineer']['ID'] = id;
body['Engineer']['District']["Name"] = district;
body['TimeInterval']['Start'] = start;
body['TimeInterval']['Finish'] = finish;

done({
  "request_vendor_body": body
});

function addToList (list, newEntity) {
  if (!list.includes(newEntity)) {
    list.push(newEntity);
  }
  return list;
}
let objectList = [];

//If list of objects exist withing CE then display that.
if (object_names) {
	for (let i = 0; i < object_names.length; i++) {
		let objName = object_names[i];
		objectList = addToList(objectList, objName);
	}
}

//If fetchAll parameter is set to true, then the response received from vendor API is appended to the list of CE specific objects list populated above.
if (request_parameters && request_parameters['fetchAll'] && request_parameters['fetchAll'] === 'true') {
  var rb =  response_body;
  for(var i =0; i < rb.length; i++)
    {
 	    let entity = rb[i]["ProductName"];
 	    objectList = addToList(objectList, entity);

    }
}

done ({
	"response_body": objectList
})

var body = request_vendor_body;
if (request_parameters && request_parameters['fetchAll'] && request_parameters['fetchAll'] === 'true') {
  done({
	"continue": true,
	"request_vendor_body": body
});
} else {
  done({ continue: false });
}

var body = request_vendor_body_map;
var taskBody = body["Task"];
if(taskBody != undefined || taskBody != null) {
  body["Task"]["@objectType"] = "Task";
}

done({
  "request_vendor_body": JSON.stringify(body)
})

var resp = response_body;

